pragma solidity ^0.4.24;

import "../ens/ENS.sol";
import "./Proxiable.sol";
import "../lib/Ownable.sol";

 /**
 * @title KomgoResolver contract
 * @author Fernando Garcia
 * @notice A simple resolver anyone can use.
 * @notice Only allows the owner of a node to set its address.
 */
contract KomgoResolver is Proxiable, Ownable {

    event AddrChanged(bytes32 node, address a);
    event ABIChanged(bytes32 node, uint256 indexed contentType, bytes data);

    struct Record {
        address addr;
        mapping(uint256=>bytes) abis;
    }

    ENS ens;

    mapping (bytes32 => Record) records;

    modifier only_owner(bytes32 node) {
        require(ens.owner(node) == msg.sender, "Invalid owner");
        _;
    }

    /**
     * Initialises the contract
     * May only be called by komgo.
     * @param _ensAddr The ens address
     */
    function initialise(ENS _ensAddr) public onlyOwner {
        require(ens == address(0), "ens already set");
        ens = _ensAddr;
    }

    /**
     * Sets the address of the new logic contract
     * May only be called by komgo.
     * @param _newResolver The address of the new resolver
     */
    function updateImplementation(address _newResolver) public onlyOwner {
        updateCodeAddress(_newResolver);
    }

    /**
     * Sets the address associated with an ENS node.
     * May only be called by the owner of that node in the ENS registry.
     * @param node The node to update.
     * @param addr The address to set.
     */
    function setAddr(bytes32 node, address addr) public only_owner(node) {
        records[node].addr = addr;
        AddrChanged(node, addr);
    }

    /**
     * Sets the ABI associated with an ENS node.
     * Nodes may have one ABI of each content type. To remove an ABI, set it to
     * the empty string.
     * @param node The node to update.
     * @param contentType The content type of the ABI
     * @param data The ABI data.
     */
    function setABI(bytes32 node, uint256 contentType, bytes data) public only_owner(node) {
        // Content types must be powers of 2
        require(((contentType - 1) & contentType) == 0);

        records[node].abis[contentType] = data;
        ABIChanged(node, contentType, data);
    }

    /**
     * Returns the ABI associated with an ENS node.
     * Defined in EIP205.
     * @param node The ENS node to query
     * @param contentTypes A bitwise OR of the ABI formats accepted by the caller.
     * @return contentType The content type of the return value
     * @return data The ABI data
     */
    function ABI(bytes32 node, uint256 contentTypes) public view returns (uint256 contentType, bytes data) {
        Record storage record = records[node];
        for (contentType = 1; contentType <= contentTypes; contentType <<= 1) {
            if ((contentType & contentTypes) != 0 && record.abis[contentType].length > 0) {
                data = record.abis[contentType];
                return;
            }
        }
        contentType = 0;
    }

    /**
     * Returns the address associated with an ENS node.
     * @param node The ENS node to query.
     * @return The associated address.
     */
    function addr(bytes32 node) public view returns (address) {
        return records[node].addr;
    }
}

